import React, { useEffect, useState } from 'react';

const Calendar = () => {
  const daysOfWeek = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];
  const months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];
  
  const [currentMonth, setCurrentMonth] = useState(new Date().getMonth());
  const [currentYear, setCurrentYear] = useState(new Date().getFullYear());
  const [theme, setTheme] = useState(months[new Date().getMonth()].toLowerCase());

  useEffect(() => {
    showCurrentMonth();
    setTheme(months[currentMonth].toLowerCase());
  }, [currentMonth, currentYear]);

  const nextMonth = () => {
    setCurrentMonth(prev => prev === 11 ? 0 : prev + 1);
    if (currentMonth === 11) setCurrentYear(prev => prev + 1);
  };

  const prevMonth = () => {
    setCurrentMonth(prev => prev === 0 ? 11 : prev - 1);
    if (currentMonth === 0) setCurrentYear(prev => prev - 1);
  };

  const showCurrentMonth = () => {
    const currentDate = new Date(currentYear, currentMonth, 1);
    const firstDayOfMonth = currentDate.getDay();
    const daysInMonth = new Date(currentYear, currentMonth + 1, 0).getDate();
    const daysInPrevMonth = currentMonth === 0 ? new Date(currentYear - 1, 11, 0).getDate() : new Date(currentYear, currentMonth, 0).getDate();

    let table = [];
    let date = 1;
    let prevMonthDate = daysInPrevMonth - firstDayOfMonth + 1;
    let nextMonthDate = 1;

    for (let i = 0; i < 6; i++) {
      let row = [];
      for (let j = 0; j < 7; j++) {
        if (i === 0 && j < firstDayOfMonth) {
          row.push(<div key={`prev-${prevMonthDate}`} className="cell disable">{prevMonthDate}</div>);
          prevMonthDate++;
        } else if (date > daysInMonth) {
          row.push(<div key={`next-${nextMonthDate}`} className="cell disable">{nextMonthDate}</div>);
          nextMonthDate++;
        } else {
          const isActive = date === new Date().getDate() && currentMonth === new Date().getMonth() && currentYear === new Date().getFullYear();
          row.push(<div key={`current-${date}`} className={`cell ${isActive ? 'active' : ''}`}><span>{date}</span></div>);
          date++;
        }
      }
      table.push(<div key={`row-${i}`} className="row">{row}</div>);
      if (date > daysInMonth) break;
    }

    return table;
  };

  return (
    <div className={`calendar-container`} data-theme={theme}>
      <div className="calendar">
        <div className="header">
          <a data-action="prev-month" onClick={prevMonth} href="javascript:void(0)" title="Previous Month">
            <i></i>
          </a>
          <div className="text" data-render="month-year">
            <span>{months[currentMonth]} {currentYear}</span>
          </div>
          <a data-action="next-month" onClick={nextMonth} href="javascript:void(0)" title="Next Month">
            <i></i>
          </a>
        </div>
        <div className="months" data-flow="left">
          <div className="month month-a" data-active="true">
            <div className="render render-a">
              <div className="table">
                <div className="row head">
                  {daysOfWeek.map(day => <div key={day} className="cell">{day}</div>)}
                </div>
                {showCurrentMonth()}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Calendar;
